import React, { Component } from "react";
import PropTypes from 'prop-types'
import {
  Container,
  Box,
  Grid,
  Paper,
  Typography,
  makeStyles,
} from '@material-ui/core';
import TopMenuBar from "../components/TopMenuBar";
import BottomMenuBar from '../components/BottomMenuBar';
import {Map as LeafletMap, TileLayer, Marker, Popup} from 'react-leaflet';
import NodeTable from './nodeTable';

const useStyles = makeStyles(theme => ({
  root: {
    display: 'flex',
  },
  paper: {
    padding: theme.spacing(2),
    display: 'flex',
    overflow: 'auto',
    flexDirection: 'column',
  },
  container: {
    paddingTop: theme.spacing(4),
    paddingBottom: theme.spacing(4),
  },
}));

export default function Dashboard() {
  const classes = useStyles();
  return (
    <Container className={classes.root}>
      <TopMenuBar block pageName="Dashboard" hamburgerMenu={false} closeButtonOnly={false} closeWithPrompt={false} backButton={false}/>
        <Grid container spacing={3}>
          <Grid item xs={6}>
            <Paper className={classes.paper}>
              <Box p={2}>
                <Typography variant="h6" component="h2">Today</Typography>
        </Box>
            </Paper>
          </Grid>
          <Grid item xs={6}>
            <Paper className={classes.paper}>
              <Box p={2}>
                <Typography variant="h6" component="h2">Node status</Typography>

        </Box>
            </Paper>
          </Grid>
          <Grid item xs={6}>
            <Paper className={classes.paper}>
                <Box p={1}>
                </Box>
              </Paper>
            </Grid>
          <Grid item xs={6}>
            <Paper className={classes.paper}>
              <Box p={1}>
                <NodeTable />
              </Box>
            </Paper>
          </Grid>
        </Grid>
        <BottomMenuBar slectedIcon={1} block/>
      </Container>
    );
  }
